ICI TOU.TV, c'est le meilleur de la télé quand vous le voulez!
- des séries contemporaines et des séries cultes provenant de partout dans le monde; 
- des séries classiques de la télévision québécoise;
- des films (courts et longs métrages) et documentaires;
- des magazines et des émissions d’affaires publiques;
- des émissions de variétés et d’humour;
- des séries originales;
- des spectacles et événements.

Profitez d'ICI TOU.TV EXTRA pour visionner une foule d'émissions, des séries complètes d'ici et d'ailleurs et des primeurs avant leur diffusion télé. Profitez également d'un accès exclusif à la section VÉRO.TV, inclus dans votre abonnement à l'EXTRA!

Bref, ICI TOU.TV c'est plus de 3600 titres à visionner selon vos envies!

Abonnement à ICI TOU.TV EXTRA
Il est désormais possible de s'abonner à ICI TOU.TV EXTRA directement dans l'application! L'abonnement est offert au coût de 6,99$ par mois.
Le montant de votre abonnement est facturé automatiquement sur votre compte iTunes à la confirmation de l'abonnement. Votre abonnement est reconduit automatiquement sauf si vous désactivez cette option au moins 24 heures avant la fin de la période en cours. Aucune résiliation n'est possible en cours d'abonnement. L'abonnement et son renouvellement peuvent être gérés directement à partir de votre compte dans l'App Store. 

Conditions d'utilisation: https://abonnements.radio-canada.ca/static/conditions_abonnement.pdf

